import '../styles/globals.css';
import 'bootstrap/dist/css/bootstrap.css';
import 'react-toastify/dist/ReactToastify.css';
import 'material-icons';

function MyApp({
	Component,
	pageProps
}) {
	return <Component {
		...pageProps
	}
	/>;
}

export default MyApp;
